      "content": "pragma solidity 0.8.20;
// SPDX-License-Identifier: MIT

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract LandSale2 is Ownable {
    // Variables

    IERC20 public MTVT;
    IERC721 public NFT;
    address public nftStorage;
    address public feeRecipient;
    uint256 public price;

    // Constructor

    constructor(
        address _MTVT,
        address _NFT,
        address _nftStorage,
        address _feeRecipient,
        uint256 _price
    ) Ownable(msg.sender) {
        MTVT = IERC20(_MTVT);
        NFT = IERC721(_NFT);
        nftStorage = _nftStorage;
        feeRecipient = _feeRecipient;
        price = _price;
    }

    // Public functions

    function buy(uint256 _tokenId) public {
        require(
            MTVT.balanceOf(msg.sender) >= price,
            "LandShop: insufficient MTVT balance"
        );
        require(
            MTVT.allowance(msg.sender, address(this)) >= price,
            "LandShop: insufficient MTVT allowance"
        );
        require(
            NFT.ownerOf(_tokenId) == nftStorage,
            "LandShop: NFT is not in storage"
        );
        require(
            NFT.getApproved(_tokenId) == address(this) ||
                NFT.isApprovedForAll(nftStorage, address(this)),
            "LandShop: is not approved to transfer NFT from storage"
        );
        MTVT.transferFrom(msg.sender, feeRecipient, price);
        NFT.transferFrom(nftStorage, msg.sender, _tokenId);

        emit NftBought(msg.sender, _tokenId);
    }

    // Private functions

    function setPrice(uint256 _price) public onlyOwner {
        require(_price > 0, "LandShop: price can't be zero");
        price = _price;
        emit PriceChanged(_price);
    }

    function setFeeRecipient(address _feeRecipient) public onlyOwner {
        require(
            _feeRecipient != address(0),
            "LandShop: fee recipient can't be zero address"
        );
        feeRecipient = _feeRecipient;
        emit FeeRecipientChanged(_feeRecipient);
    }

    function setNftStorage(address _nftStorage) public onlyOwner {
        require(
            _nftStorage != address(0),
            "LandShop: nft storage can't be zero address"
        );
        nftStorage = _nftStorage;
        emit NftStorageChanged(_nftStorage);
    }

    // Emergency functions

    function withdrawMTVT() public onlyOwner {
        MTVT.transfer(msg.sender, MTVT.balanceOf(address(this)));
    }

    function withdrawNFT(uint256 _tokenId) public onlyOwner {
        NFT.transferFrom(address(this), msg.sender, _tokenId);
    }

    // Events

    event PriceChanged(uint256 price);
    event FeeRecipientChanged(address feeRecipient);
    event NftStorageChanged(address nftStorage);
    event NftBought(address indexed buyer, uint256 tokenId);
}
"
